1 ovo
2 colheres das de sopa de água
1 colher das de sopa de azeite de oliva
1 pitada de sal a gosto
2 colheres das de sopa de farinha de amêndoas
1 colher das de chá de psylium ( opcional)
1 colher das de café de fermento químico
Modo de preparo:
1. Em uma tigela bata o ovo, água, azeite e sal com um fuê ou garfo.
2. Adicione a farinha e o psylium e misture até homogenizar.
3. Por último, misture o fermento.
4. Aqueça a frigideira com azeite de oliva ou manteiga.
5. Adicione a massa do pão e coloque o fogo baixo.
6. Deixe cozinhar dos dois lados.
Em frigideira pequena você pode cortar e rechear. Se a sua frigideira for média- grande, ficará na forma de panqueca, mais fininha.
